description:
                   Chronology of American Indian History-2010kaiser
                   ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


A fascinating, in-depth timeline of American Indian history, 'Chronology of American Indian History, Updated Edition', updated and expanded with current information, describes thousands of years of events that helped shape the lives and cultures of Native Americans, as well as American society as a whole - from their ancestors' arrival in North America to the present.

Author: Liz Sonneborn
Title: Chronology of American Indian History
Publisher: Facts on File
Year: 2007
Format: PDF

